import React from "react";

export const Product = () => {
  return (
    <div style={{ textAlign: "center" }}>
      <img style={{ width: "75%" }} alt="product" />

      <form style={{ marginTop: "10px" }}>
        <label style={{ textAlign: "right" }}></label>
        <input
          type="number"
          defaultValue={0}
          min="0"
          name="quantity"
          id="quantity"
        />
      </form>
    </div>
  );
};
